import React from 'react'
import Slider from 'react-slick';
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
import {Link} from 'react-router-dom'
const Topcrypto = () => {   
    const top=[
        { id: 1, title: "Bitcoin"  ,
        image:"https://images.unsplash.com/photo-1628151015968-3a4429e9ef04?w=500&auto=format&fit=crop&q=60&ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxzZWFyY2h8MTZ8fGJpdGNvaW58ZW58MHx8MHx8fDA%3D"},
        { id: 2, title: "Ethereum"  ,
        image:"data:image/jpeg;base64,"},
        { id: 3, title: "Ripple" ,
        image:"data:image/jpeg;base64," },
        { id: 4, title: "Tether" ,image:"data:image/jpeg;base64," },
        { id: 5, title: "Binance Coin" ,image:"data:image/jpeg;base64," },
        { id: 6, title: "Cardano" ,image:"data:image/jpeg;base64," },
        { id: 7, title: "Solana" ,image:"data:image/jpeg;base64," },
        { id: 8, title: "Polkadot"  ,image:"data:image/jpeg;base64,"},
        { id: 9, title: "Chainlink" ,image:"data:image/jpeg;base64," },
        { id: 10, title: "Litecoin" ,image:"data:image/jpeg;base64," },
]
var settings = {
  // dots: true,
  autoplay: true,
    autoplaySpeed: 2000,
    cssEase: "linear",
  infinite: false,
  speed: 500,
  slidesToShow: 5,
  slidesToScroll: 4,
  initialSlide: 0,
  responsive: [
    {
      breakpoint: 1024,
      settings: {
        slidesToShow: 4,
        slidesToScroll: 3,
        infinite: true,
        dots: true
      }
    },
    {
      breakpoint: 600,
      settings: {
        slidesToShow: 3,
        slidesToScroll: 2,
        initialSlide: 2
      }
    },
    {
      breakpoint: 480,
      settings: {
        slidesToShow: 2,
        slidesToScroll: 1
      }
    }
  ]
};
  return (
    <div>
    
    <div className="container"><hr />
    <h3>Top 10 Cryptos </h3>
    {/* <hr /> */}
        <div className="row">  
         <Slider {...settings} className="cardinfo">
      {top.map((tops)=>
        <div className="card cards">
            <div className="  slider-container content13 mx-4" key={tops.id}>  
            <Link to="/Topin">
            <img src={tops.image} alt="" className="mt-3 mx-3 d-flex justify-content-center" width="130px" height="100px" />
            
            </Link></div> 
          <h6 className="ms-5">{tops.title}</h6>
            </div>
            /* </div> */
        )} </Slider>  
        {/* <hh className="mt-3 mb-3" /> */}
            
        </div>
    </div>
    
    </div>
  )
}
 

export default Topcrypto